import React from "react";
import { Header, Container, Grid } from 'semantic-ui-react';

function Tokusatsu() {
  return (
      <Container>
        <br/>
        <Header as ="h2" textAlign="center">Japanese Tokusatsu Paper</Header>
        <Grid textAlign='center'></Grid>
        <Container text>
          <hr/>
        </Container>
      </Container>
  );
}

export default Tokusatsu;
